//props-Types
import PropTypes from 'prop-types';

const Btn = ({ text, backgroundColor }) => {
    return (
        <button
            style={{
                backgroundColor,
            }}
        >
            {text}
        </button>
    );
};

Btn.propTypes = {
    text: PropTypes.string.isRequired,
};

//App.js에서 Btn을 가져올 수 있도록 Btn을 exprot한다.
export default Btn;
